import ExpenseItem from "./ExpenseItem";

import "./ExpensePrice.css"

const Expenses = function (props) {
    console.log(props)
    return (
        <div>
      <ExpenseItem title={prop.expenses[0].title} amount={prop.expenses[0].amount} date={prop.expenses[0].date} />
      <ExpenseItem title={prop.expenses[1].title} amount={prop.expenses[1].amount} date={prop.expenses[1].date} />
      <ExpenseItem title={prop.expenses[2].title} amount={prop.expenses[2].amount} date={prop.expenses[2].date} />
      <ExpenseItem title={prop.expenses[3].title} amount={prop.expenses[3].amount} date={prop.expenses[3].date} />
      <ExpenseItem title={prop.expenses[4].title} amount={prop.expenses[4].amount} date={prop.expenses[4].date} /> 
        </div>
    );
}

export default Expenses;
